import './App.css';
import HeroImage from "./pictures/MagdaHero.jpg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'
import { useTrail,animated } from '@react-spring/web';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowUpRightFromSquare} from '@fortawesome/free-solid-svg-icons';

let p1=2;
 let p2=3;

window.addEventListener('resize',resize)

function resize(){

   if(window.innerWidth<1500){
     p1=2.5;
     p2=3.4
   }
}

function App() {



  return (
    <div>



    <Parallax pages={4}>
      <ParallaxLayer className='z-20'>

        <NavBar></NavBar>

      </ParallaxLayer>
      <ParallaxLayer factor={1} speed={0.5}>
        <div className="h-screen flex justify-center items-center z-0">
          <HeroText></HeroText>
        </div>
      </ParallaxLayer>
      <ParallaxLayer  offset={0.6} speed={0.75}>
        <HeroSubText></HeroSubText>
      </ParallaxLayer>
      <ParallaxLayer className='z-10' speed={0.85} offset={0.999} factor={3}>
        <ProjectWrapper></ProjectWrapper>
      </ParallaxLayer>
